const numberLocation = document.getElementById("number-place")
const percentageLocation = document.getElementById("percentages-div")
const canvas = document.getElementById("canvas")
const ctx = canvas.getContext("2d")
const canvasRect = canvas.getBoundingClientRect()

canvas.width = canvas.height = 28
ctx.fillStyle = "#353839"

mouseDown = false
brushSize = 2

document.addEventListener("mousedown", mouseClick)
document.addEventListener("mouseup", mouseClick)
document.addEventListener("mousemove", e => (draw(e)))

function draw(e) {

    if (mouseDown) {
        x = (e.clientX - canvasRect.left) * (canvas.width / canvasRect.width)
        y = (e.clientY - canvasRect.top) * (canvas.height / canvasRect.width)
        ctx.fillRect(x - brushSize / 2, y - brushSize / 2, brushSize, brushSize)
        classify()
    }
}

function getInput() {
    let inputs = []
    let canvasData = ctx.getImageData(0, 0, canvas.width, canvas.height).data

    for (let i = 0; i < 28 * 28; i++) {
        inputs.push(canvasData[i * 4 + 3])     
    }

    return inputs
}

function mouseClick() {
    mouseDown = !mouseDown
}

