function classify() {

    let outputs = getInput()

    for (let i = 0; i < weights.length; i++) {

        let newOutputs = []
        for (let e = 0; e < weights[i].length; e++) {

            let output = biases[i][e]
            for (let j = 0; j <outputs.length; j++) {
                output += outputs[j] * weights[i][e][j]
            }  
            
            newOutputs.push(sigmoid(output))
        }    

        outputs = newOutputs
    }

    displayData(outputs)
}

function sigmoid(input) {
    return (1 / (1 + Math.exp(-input)))
}

function displayData(outputs) {

    numberLocation.innerHTML = outputs.indexOf(Math.max(...outputs))    
    percentageLocation.innerHTML = ""
    
    for (let i = 0; i < 10; i++) {

        let number = (outputs[i] * 100).toFixed(2)
        percentageLocation.innerHTML += `<p>${i} - ${number}%</p>`   
    }
}

